style.css:
@-moz-document url("https://www.roblox.com/") {
body {
    background-color: black !important;}

  
main#container-main.container-main .content {
    margin-top:15px;
    border-radius: 25px;
    padding:20px;
    max-width: 53%;
    background-color:rgba(255,255,255,0.62);
    box-shadow: 2px 2px 5px  rgba(0,0,0,0.2);
}

main#container-main.container-main{
    background: linear-gradient(90deg, rgba(253,255,182,1), rgba(234,253,190,1), rgba(180,242,174,1), rgba(211,255,237,1), rgba(199,219,255,1), rgba(211,207,255,1), rgba(215,206,255,1), rgba(244,201,255,1));
}

div#navigation.rbx-left-col {
    background-color:rgba(255,255,255,0.75);
    border-right: 2px solid rgb(204,204,204);
}

div.container-fluid {
    background-color:white;
     border-bottom: 2px solid rgb(205,205,205);
}

#HomeContainer  div.section  div  h1  a.avatar.avatar-card-fullbody  span  thumbnail-2d > span  img{
    background-color: blue;
}


span.thumbnail-2d-container{
    border-radius:5px;
     box-shadow: 2px 2px 5px  rgba(0,0,0,0.48);
  }
}
